import { Link } from "react-router-dom";
function MainNavigation() {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <Link to="/"></Link>Home
          </li>
          <li>
            <Link to="/products"></Link>Products
          </li>
        </ul>
      </nav>
    </header>
  );
}
export default MainNavigation;
